(642, 'Triple Pack Sal de Maras 600gr', '7000 01 001', NULL, 21900.00, 1, '2022-10-18 13:08:48', '2023-02-22 13:24:30', 117, 8000, '<ul>\r\n	<li>&iexcl;Una mezcla perfecta de&nbsp;<strong>Sal de Maras con finas hierbas arom&aacute;ticas y especias</strong>!</li>\r\n	<li><strong>La Sal de Maras con Especias</strong>&nbsp;es la preferida para hacer parrillas y tambi&eacute;n en el uso en la cocina gourmet debido a su sabor delicado, frescura y olor especial que brinda a cada plato.</li>\r\n	<li>La&nbsp;<strong>Sal Rosada Ahumada</strong>&nbsp;es ideal para sazonar cortes de carnes (res, cerdo y pollo) para preparaciones en parrillas y al horno. Recomendada por grandes parrilleros y maestros de las brasas.</li>\r\n	<li>La&nbsp;<strong>Sal de Maras fina</strong>&nbsp;posee un sabor &uacute;nico e inigualable, es el complemento perfecto para darle un toque especial a todas las preparaciones, con la sal de maras podr&aacute;s crear platos saludables y deliciosos.</li>\r\n</ul>', NULL, 1, 2, 21900.00, '', 0, NULL, NULL, NULL, NULL),
(643, 'Set 2 Café Orgánico Kuntu Molido 250gr', '7000 01 002', NULL, 19900.00, 1, '2022-10-18 17:21:38', '2023-02-22 13:24:30', 117, 8001, '<h3>Descripci&oacute;n del producto</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;Caf&eacute; 100%&nbsp; Ar&aacute;bica</strong>&nbsp;de aroma pronunciado con acidez fina y jugosa, cuerpo medio alto y con notas a frutos secos y chocolate.</p>\r\n\r\n<p><strong>Kuntu Caf&eacute;</strong>&nbsp;es el resultado de la Pasi&oacute;n y Experiencia de nuestros agricultores de caf&eacute;, quienes despu&eacute;s de a&ntilde;os de tradici&oacute;n cafetera, hoy comparten con nosotros sus sue&ntilde;os y la magia del mejor caf&eacute; de altura, de excelente aroma, cuerpo y sabor.</p>\r\n\r\n<p>Nuestro caf&eacute; es cultivado sin el uso de componentes qu&iacute;micos, con t&eacute;cnicas ecol&oacute;gicas que cuidan el medio ambiente y nuestra salud.</p>', NULL, 1, 2, 19900.00, '', 0, NULL, NULL, NULL, NULL),
(644, 'Triple Pack Moledor Sal de Maras', '7000 01 003', NULL, 21900.00, 1, '2022-10-18 18:06:57', '2023-02-22 13:24:30', 117, 8002, '<p><em><strong>Descripci&oacute;n del producto</strong></em></p>\r\n\r\n<ul>\r\n	<li><strong>Sal de Maras en Grano Grueso</strong>,&nbsp;<strong>ideal para parrilla</strong>&nbsp;y para cocinar diversos cortes de carne roja, carne de cerdo, pollo y pescados en la parrilla o en preparaciones al horno.</li>\r\n	<li><strong>La Sal de Maras con Especias</strong>&nbsp;es la preferida para hacer parrillas y tambi&eacute;n en el uso en la cocina gourmet debido a su sabor delicado, frescura y olor especial que brinda a cada plato.</li>\r\n	<li>La&nbsp;<strong>Sal de Maras C&iacute;trica</strong>&nbsp;posee un ligero dulzor y un toque c&iacute;trico que permiten crear un caramelizado no solo en pescados, sino tambi&eacute;n en carne de cerdo.&nbsp; Los ingredientes permiten crear un balance perfecto de aromas, sabor y un toque c&iacute;trico en los platos.</li>\r\n</ul>', NULL, 1, 2, 21900.00, '', 0, NULL, NULL, NULL, NULL),
(645, 'Set 2 Picadillo Aceituna (Negra/Verde)', '7000 01 004', NULL, 15900.00, 1, '2022-10-18 19:06:34', '2023-02-22 13:24:30', 117, 8003, '<h3>Descripci&oacute;n del producto</h3>\r\n\r\n<p>Conocido tambi&eacute;n como Tapenade, el&nbsp;<strong>Picadillo de Aceitunas Negras/verde con Sal Rosada de Maras</strong>&nbsp;tiene una textura abundante, producido a base de aceitunas e ingredientes cuidadosamente seleccionados, teniendo a la Sal de Maras como el ingrediente diferenciador para realzar e intensificar el sabor.</p>\r\n\r\n<p>Puedes probar este producto de diferentes maneras, convencionalmente en tostadas, galletas o agreg&aacute;ndolo a aderezos para ensaladas o como ingrediente para salsas, pizzas y/o platos m&aacute;s elaborados.</p>\r\n\r\n<p>Puede ser consumido de forma directa tambi&eacute;n, la&nbsp;<strong>Sal de Maras</strong>&nbsp;neutraliza el sabor fuerte de las aceitunas negras.</p>\r\n\r\n<p>Beneficios:</p>\r\n\r\n<ul>\r\n	<li>Snack saludable, con un sabor &uacute;nico.</li>\r\n</ul>\r\n\r\n<p>Usos:</p>\r\n\r\n<ul>\r\n	<li>Snack.</li>\r\n	<li>Cocina.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', NULL, 1, 5, 15900.00, '', 0, NULL, NULL, NULL, NULL),
